import "./App.css";

function App() {
  return (
    <div className="App">
      <header
        className="App-header"
        style={{ backgroundColor: "#ffcc00", minHeight: "100vh", color: "black" }}
      >
        <h1>COMP3104 - Developer Operations</h1>
        <h2>Student: Denrick Shawn Viera</h2>
        <h3>ID: 101426295</h3>
      </header>
    </div>
  );
}

export default App;
